      items: [],
      TotalAmount: 0,
      addItem: addItemToCartHandlar,
      removeItem: removeITemToCartHandalr,
    };
    
   return (
        <CartContext.Provider value={CartContext}>
        {props.children}
        </CartContext.Provider>
   );
}

